import { Route, Switch } from "react-router-dom";
import NewQuotes  from "./pages/NewQuotes";
import AllQuotes  from "./pages/AllQuotes";
import QuoteDetail from "./pages/QuoteDetail";
function App() {
  return (
    <div>
      <Switch>
        <Route path="/quotes" exact><NewQuotes/></Route>
        <Route path="/quotes/:quoteId"> <AllQuotes/></Route>
        <Route path="/new-quote"> <QuoteDetail/></Route>
      </Switch>
    </div>
  );
}

export default App;
